                freq[c - 'a']++;

            int baseAmount = -1;
            int baseCount = 0;
            int maxCount = 0;

            for (int i = 0; i < 26; i++)
            {
                if (freq[i] == 0)
                    continue;

                if (baseAmount == -1)
                {
                    baseAmount = freq[i];
                    baseCount++;
                    continue;
                }

                if (baseAmount == freq[i])
                {
                    baseCount++;
                    continue;
                }

                if (freq[i] == baseAmount + 1)
                {
                    maxCount++;
                    continue;
                }

                if (freq[i] == baseAmount - 1 && maxCount == 0)
                {
                    baseAmount = freq[i];
                    maxCount = baseCount;
                    baseCount = 1;
                    continue;
                }

                return false;
            }

            if (maxCount == 1 || baseCount == 1)
                return true;

            if (maxCount == 0 && baseAmount == 1)
                return true;

            return false;
        }

        public static int XorAllNums(int[] nums1, int[] nums2)
        {
            int result = 0;

            foreach (int n1 in nums1)
                foreach (int n2 in nums2)
                    result ^= n1 ^ n2;

            return result;
        }
    }

    public class LUPrefix
    {
        HashSet<int> set = new HashSet<int>();
        int size = 0;
        int longest = 0;

        public LUPrefix(int n)
        {
            size = n;
        }

        public void Upload(int video)
        {
            set.Add(video);
        }

        public int Longest()
        {
            for (int i = longest + 1; i <= size; i++, longest++)
            {
                if (!set.Contains(i))
                    break;
            }

            return longest;
        }
    }

